INSERT INTO `agreement` (`agreement_id`, `effectiv_date`, `agreement_text`, `creation_date`) VALUES
(1, '2011-03-02', '<html>\r\n\r\n<head>\r\n<meta http-equiv=Content-Type content="text/html; charset=windows-1252">\r\n<meta name=Generator content="Microsoft Word 12 (filtered)">\r\n<style>\r\n<!--\r\n /* Font Definitions */\r\n @font-face\r\n	{font-family:"Cambria Math";\r\n	panose-1:2 4 5 3 5 4 6 3 2 4;}\r\n@font-face\r\n	{font-family:Calibri;\r\n	panose-1:2 15 5 2 2 2 4 3 2 4;}\r\n /* Style Definitions */\r\n p.MsoNormal, li.MsoNormal, div.MsoNormal\r\n	{margin-top:0in;\r\n	margin-right:0in;\r\n	margin-bottom:10.0pt;\r\n	margin-left:0in;\r\n	line-height:115%;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";}\r\np\r\n	{margin-right:0in;\r\n	margin-left:0in;\r\n	font-size:12.0pt;\r\n	font-family:"Times New Roman","serif";}\r\np.MsoNoSpacing, li.MsoNoSpacing, div.MsoNoSpacing\r\n	{margin:0in;\r\n	margin-bottom:.0001pt;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";}\r\n.MsoPapDefault\r\n	{margin-bottom:10.0pt;\r\n	line-height:115%;}\r\n@page Section1\r\n	{size:8.5in 11.0in;\r\n	margin:.5in 1.0in 1.0in 1.0in;}\r\ndiv.Section1\r\n	{page:Section1;}\r\n /* List Definitions */\r\n ol\r\n	{margin-bottom:0in;}\r\nul\r\n	{margin-bottom:0in;}\r\n-->\r\n</style>\r\n\r\n</head>\r\n\r\n<body lang=EN-US>\r\n\r\n<div class=Section1>\r\n\r\n<p class=MsoNoSpacing align=center style=''text-align:center''><b><span\r\nstyle=''font-size:10.0pt;font-family:"Times New Roman","serif"''>&nbsp;</span></b></p>\r\n\r\n<p class=MsoNoSpacing align=center style=''text-align:center''><b><span\r\nstyle=''font-size:10.0pt;font-family:"Times New Roman","serif"''>&nbsp;</span></b></p>\r\n\r\n<p class=MsoNoSpacing align=center style=''text-align:center''><b><span\r\nstyle=''font-size:10.0pt;font-family:"Times New Roman","serif"''>Beta test\r\nAgreement</span></b></p>\r\n\r\n<p class=MsoNoSpacing><span style=''font-size:10.0pt;font-family:"Times New Roman","serif"''>&nbsp;</span></p>\r\n\r\n<p class=MsoNoSpacing><span style=''font-size:10.0pt;font-family:"Times New Roman","serif"''>This\r\nBeta Test Agreement (&quot;Agreement&quot;) is made between Home Health Soft,\r\nInc. (&quot;Developer&quot;) and the prospective user of the Product (&quot;Recipient&quot;).\r\n<br>\r\nDeveloper is the owner of a prototype product identified as Agency Partner (the\r\n&quot;Product&quot;) which it desires to have tested by a prospective user in\r\nwhat is commonly referred to as &quot;Beta Test&quot;. <br>\r\n<br>\r\n</span></p>\r\n\r\n<p class=MsoNoSpacing><span style=''font-size:10.0pt;font-family:"Times New Roman","serif"''>The\r\nProduct contains valuable, <b><span style=''color:red''>confidential, trade\r\nsecret information</span></b> owned by Developer. <br>\r\nThe Recipient desires to test and evaluate the Product for suitability for use\r\nin its business. <br>\r\nNOW, THEREFORE, in consideration of the promises set forth herein, the parties\r\nhereto agree as follows: </span></p>\r\n\r\n<p class=MsoNoSpacing><b><span style=''font-family:"Times New Roman","serif"''>Arrangement</span></b><span\r\nstyle=''font-size:10.0pt;font-family:"Times New Roman","serif"''>:<br>\r\nDeveloper agrees to provide to Recipient the Product, and Recipient accepts the\r\nProduct, subject to the terms of this Agreement. Recipient agrees to test and\r\nevaluate the Product as provided herein, report to Developer with respect to\r\nthe usefulness and functionality of Product, and return the Product to\r\nDeveloper at the conclusion the Beta Test, all pursuant to this Agreement. </span></p>\r\n\r\n<p class=MsoNoSpacing><b><span style=''font-family:"Times New Roman","serif"''>Non-Disclosure:\r\n</span></b></p>\r\n\r\n<p class=MsoNoSpacing><span style=''font-size:10.0pt;font-family:"Times New Roman","serif"''>Recipient\r\nacknowledges and agrees that in providing the Product, Developer may disclose\r\nto Recipient certain confidential, proprietary trade secret information of\r\nDeveloper (the &quot;Confidential Information&quot;). Confidential Information\r\nmay include, but is not limited to, the Product, computer programs, flowcharts,\r\ndiagrams, manuals, schematics, development tools, specifications, design\r\ndocuments, marketing information, financial information or business plans.\r\nDuring this Agreement and for a period of 2 years, thereafter, Recipient agrees\r\nthat it will not, without the express prior written consent of Developer,\r\ndisclose any Confidential Information or any part thereof to any third party,\r\nexcept to the extent that such Confidential Information a) is or becomes\r\ngenerally available to the public through no fault of Recipient; b) is\r\nrightfully received by Recipient from a third party without limitation as to\r\nits use; or c) is independently developed by Recipient. At the termination of\r\nthis Agreement, Recipient will return the Product and all other Confidential\r\nInformation to Developer. </span></p>\r\n\r\n<p class=MsoNoSpacing><span style=''font-size:10.0pt;font-family:"Times New Roman","serif"''>Recipient\r\nalso agrees that it shall not duplicate, translate, modify, copy, printout,\r\ndisassemble, reverse-engineer or otherwise tamper with the Product or any\r\nfirmware or software provided therewith.</span></p>\r\n\r\n<p class=MsoNoSpacing><b><span style=''font-family:"Times New Roman","serif"''>License</span></b><span\r\nstyle=''font-size:10.0pt;font-family:"Times New Roman","serif"''>: <br>\r\nRecipient acknowledges that Recipients shall have only a limited,\r\nnon-exclusive, nontransferable license to use the Product for a period not to\r\nexceed 180 days. Recipient acknowledges and agrees that it will not use the\r\nProduct for any purpose that is illegal. Because the Product is a &quot;Beta\r\nTest&quot; version only and is not error or bug free, Recipient agrees that it\r\nwill use the Product carefully and will not use it in any way which might\r\nresult in any loss of its or any third party''s property or information. </span></p>\r\n\r\n<p class=MsoNoSpacing><b><span style=''font-family:"Times New Roman","serif"''>Report</span></b><span\r\nstyle=''font-size:10.0pt;font-family:"Times New Roman","serif"''>:<br>\r\nRecipient shall report to Developer, as soon as practical, any perceived defect\r\nin the Product and, following the discovery of any material defect, shall\r\nterminate its use of the Product. At the conclusion of the Beta Test, Recipient\r\nshall provide to Developer an evaluation of the Product, including both\r\npositive and negative aspects. </span></p>\r\n\r\n<p class=MsoNoSpacing><b><span style=''font-family:"Times New Roman","serif"''>Termination</span></b><span\r\nstyle=''font-family:"Times New Roman","serif"''>: </span><span style=''font-size:\r\n10.0pt;font-family:"Times New Roman","serif"''><br>\r\nRecipient may terminate this Agreement at any time prior to expiration of the\r\nBeta Test by returning the Product including all Confidential Information and\r\ncopies thereof, to Developer, along with its evaluation report. Developer may\r\nterminate this Agreement upon notice to Recipient, subject to Recipient''s\r\nobligation to return the Product, Confidential Information and all copies\r\nthereof. The obligations of Recipient in Section 2 above shall survive the\r\ntermination of this Agreement. If not earlier terminated, this Agreement shall\r\nterminate automatically upon the end of the period set forth in Section 3 and\r\nfollowing Recipient''s return of the Product and the Confidential Information. </span></p>\r\n\r\n<p class=MsoNoSpacing><b><span style=''font-family:"Times New Roman","serif"''>Developer''s\r\nWarranties: </span></b><span style=''font-size:10.0pt;font-family:"Times New Roman","serif"''><br>\r\nDeveloper represents and warrants that it has the requisite right and legal\r\nauthority to grant the license and provide the Product and the Confidential\r\nInformation as contemplated by this Agreement. DEVELOPER MAKES NO OTHER\r\nWARRANTY, EXPRESS OR IMPLIED, WITH RESPECT TO THE PRODUCT AND ALL OTHER\r\nWARRANTIES, WHETHER EXPRESS OR IMPLIED, ARE HEREBY DISCLAIMED, INCLUDING,\r\nWITHOUT LIMITATION, THE IMPLIED WARRANTIES OF MERCHANTABILITY AND FITNESS FOR A\r\nPARTICULAR PURPOSE. DEVELOPER''S SOLE LIABILITY FOR BREACH OF THE REPRESENTATION\r\nAND WARRANTY ABOVE, AND RECIPIENT''S SOLE REMEDY, SHALL BE THAT DEVELOPER SHALL\r\nINDEMNIFY AND HOLD RECIPIENT HARMLESS FROM AND AGAINST ANY LOSS, SUIT, DAMAGE,\r\nCLAIM OR DEFENSE ARISING OUT OF BREACH OF THE REPRESENTATION AND WARRANTY,\r\nINCLUDING REASONABLE ATTORNEYS'' FEES. </span></p>\r\n\r\n<p class=MsoNoSpacing><b><span style=''font-family:"Times New Roman","serif"''>Governing\r\nLaw:</span></b><span style=''font-family:"Times New Roman","serif"''> </span><span\r\nstyle=''font-size:10.0pt;font-family:"Times New Roman","serif"''><br>\r\nThis Agreement is to be governed by, construed and enforced according to the\r\nlaws of the State of Texas. </span></p>\r\n\r\n<p class=MsoNoSpacing><b><span style=''font-family:"Times New Roman","serif"''>No\r\nAssignment:</span></b></p>\r\n\r\n<p class=MsoNoSpacing><span style=''font-size:10.0pt;font-family:"Times New Roman","serif"''>Recipient\r\nmay not assign this Agreement without the prior written consent of Developer.\r\nThis Agreement shall be binding upon and inured to the benefit of the parties\r\nand their respective administrators, successors and assigns. </span></p>\r\n\r\n<p class=MsoNoSpacing><b><span style=''font-family:"Times New Roman","serif"''>Headings:</span></b><span\r\nstyle=''font-family:"Times New Roman","serif"''> </span><span style=''font-size:\r\n10.0pt;font-family:"Times New Roman","serif"''><br>\r\nHeadings used in this Agreement are provided for convenience only and shall not\r\nbe used to construe meaning or intent. </span></p>\r\n\r\n<p class=MsoNoSpacing><b><span style=''font-family:"Times New Roman","serif"''>Final\r\nAgreement:</span></b><span style=''font-family:"Times New Roman","serif"''> </span><span\r\nstyle=''font-size:10.0pt;font-family:"Times New Roman","serif"''><br>\r\nThis Agreement terminates and supersedes all prior understandings or agreements\r\non the subject matter hereof. This Agreement may be modified only by a further\r\nwriting that is duly executed by both parties. </span></p>\r\n\r\n<p class=MsoNoSpacing><b><span style=''font-family:"Times New Roman","serif"''>Arbitration</span></b><b><span\r\nstyle=''font-size:10.0pt;font-family:"Times New Roman","serif"''>:</span></b><span\r\nstyle=''font-size:10.0pt;font-family:"Times New Roman","serif"''> <br>\r\nThe parties agree that they will use their best efforts to amicably resolve any\r\ndispute arising out of or relating to this Agreement. Any controversy, claim or\r\ndispute that cannot be so resolved shall be settled by final binding\r\narbitration in accordance with the rules of the American Arbitration\r\nAssociation, and judgment upon the award rendered by the arbitrator or\r\narbitrators may be entered in any court having jurisdiction thereof. Any such\r\narbitration shall be conducted in the city where the Developer''s headquarters\r\nare located, or such other place as may be mutually agreed upon by the parties.\r\nWithin fifteen (15) days after the commencement of the arbitration, each party\r\nshall select one person to act as arbitrator, and the two arbitrators so\r\nselected shall select a third arbitrator within ten (10) days of their\r\nappointment. Each party shall bear its own costs and expenses and an equal\r\nshare of the arbitrator’s expenses and administrative fees of arbitration. </span></p>\r\n\r\n<p class=MsoNoSpacing><span style=''font-size:10.0pt;font-family:"Times New Roman","serif"''><br>\r\n<br>\r\nTo agree to the terms specified above, please check “I AGREE” and then press\r\nthe button “SAVE”.</span><span style=''font-size:12.0pt;font-family:"Times New Roman","serif"''>\r\n<br>\r\n<br>\r\n<br>\r\n</span></p>\r\n\r\n<p class=MsoNoSpacing>&nbsp;</p>\r\n\r\n<p class=MsoNoSpacing>&nbsp;</p>\r\n\r\n</div>\r\n\r\n</body>\r\n\r\n</html>', '2011-03-02 16:45:09');
