(25, 464, NULL, 'Puro, Chile, es tu cielo azulado,puras brisas te cruzan tambin,y tu campo de flores bordadoes la copia feliz del Edn. Majestuosa es la blanca montaña que te dio por baluarte el Señor, y ese mar que tranquilo te baa te promete futuro esplendor.Esas galas, oh, Patria!, esas flores Puro, Chile, es tu cielo azulado,puras brisas te cruzan tambin,y tu campo de flores bordadoes la copia feliz del Edn. Majestuosa es la blanca montaa que te dio por baluarte el Seor, y ese mar que tranquilo te baa te promete futuro esplendor.Esas galas, oh, Patria!, esas flores.', NULL, NULL, NULL),
(26, 470, NULL, 'Burger''s Daughter is a political and historical novel by the South African Nobel recipient Nadine Gordimer (pictured), first published in 1979 in the United Kingdom by Jonathan Cape. Banned in South Africa for three months by the Publications Control Board, the book follows a group of white anti-apartheid activists who seek to overthrow the South African government. Rosa, the title character, comes to terms with her father''s legacy as an activist in the South African Communist Party. Gordimer was involved in the anti-apartheid movement and knew many of the activists, including Bram Fischer, the defence lawyer at Nelson Mandela''s treason trial; she has described the book as a "coded homage" to him. The novel was generally well received by critics; a review in The New York Review of Books described the style of writing as "elegant" and "fastidious", belonging to a "cultivated upper class". In 1980 it won the Central News Agency Literary Award. When Gordimer won the 1991 Nobel Prize in Literature, Burger''s Daughter was one of the books cited during the awards ceremony. (Full article...)', NULL, NULL, NULL),
