(101, 484, 'Primary Test Diagnosis', 'Therapy Test Diagnosis', '2015-06-07', '2015-10-02', 1, NULL, NULL, NULL, NULL, NULL, NULL, 'Patient presents with complaints of generalized weakness, impaired B LE sensation, L. LE numbness/tingling/burning sensation, decreased balance, moderate to severe LB, neck,& L. LE pain and decreased mobility secondary to dialysis treatment 3 days per week. Pt c/o decrease of strength on L. hand "I''am not even able to hold a empty cup". Patient reports that she has difficulty with walking, curve negotiation, getting up from toilet, and dressing. Pt doesn''t feel safe walking with st. cane. Pt states that she would like to be able to walk and negotiate stairs with less fatigue and less risk of falling. She wants to increase her strength on L. LE and L. arm to be able to dress and do her own chores w/o risk of falling. ', NULL, NULL, NULL, NULL, NULL, 5, NULL, NULL, NULL, NULL, NULL, 5, NULL, NULL, NULL, NULL, NULL, 8, NULL, NULL, NULL, NULL, NULL, 5, NULL, NULL, NULL, NULL, NULL, 5, NULL, NULL, NULL, NULL, NULL, 5, NULL, NULL, NULL, NULL, NULL, 5, NULL, NULL, NULL, NULL, NULL, 5, NULL, NULL, NULL, NULL, NULL, 5, NULL, NULL, NULL, NULL, NULL, 5, NULL, NULL, NULL, NULL, NULL, 5, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, N